def check_target(target):
    headers = {
        'authority': 'mbasic.facebook.com',
        'accept': 'text/html,application/xhtml+xml,application/xml;q=0.9,image/avif,image/webp,image/apng,*/*;q=0.8,application/signed-exchange;v=b3;q=0.7',
        'accept-language': 'en-US,en;q=0.9',
        'cache-control': 'max-age=0',
        'sec-fetch-dest': 'document',
        'sec-fetch-mode': 'navigate',
        'sec-fetch-site': 'none',
        'sec-fetch-user': '?1',
        'upgrade-insecure-requests': '1',
        'user-agent': 'Mozilla/5.0 (Linux; Android 10; Pixel 4) AppleWebKit/537.36 (KHTML, like Gecko) Chrome/109.0.0.0 Mobile Safari/537.36',
    }
    response = requests.get(f'https://mbasic.facebook.com/login/device-based/password/?uid={target}&flow=login_no_pin&refsrc=deprecated&_rdr',headers=headers).text
    if "Sorry" in response or "Not Found" in response:
        return 0
    elif "log in" in response or "Phone number or email" in response:
        return 0
    else:
        parser = BeautifulSoup(response,'html.parser')
        table = parser.find("table",role="presentation")
        img = table.find("img",src=True)
        name = img['alt'].replace(', profile picture','')
        return name

